INSERT INTO `v1_aa20861bb091ed4f98fb96fe54bcecd9693d5d440d7ce22ddce037be1ebb2d3b` VALUES ("ねぇねぇ、騎士クン\n手伝ってあげようよ～", 2, "お！\nあそこに困ってそうな人発見！", 1.4, 1001, 0, 0, "春咲 ひより", 1, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 1, 0, 0);
